    //props in class component
    const Appleinfo = {color:"Green", type:"Gala"}

    return(
        <>
        <h1>Who live inside by Gaba</h1>
        {/* <Car brand = {brand} color = {color}/> */}
        <Car carinfo = {carinfo}/>
        <Apple Appleinfo = {Appleinfo}/>
        </>
    )
}
export default Gaba;
